import React from 'react';
import { Accordion } from 'react-bootstrap';
import './Conferenceteam.css';
import image from '../../assests/male1.jpg';

const ConferenceTeam = () => {
    const details= [
        {
            id:1,
            header:'Patron',
            name: 'person1',
            position:'patron',
            contact : 9876543210,
            keys:1
        },
        {
            id:1,
            header:'Patron',
            name: 'person1',
            position:'chief patron',
            contact : 9876543210,
            keys:2
        },
    ]

    const details2 = [
           {
            id:2,
            header:'',
            name: '',
            position:'',
            contact : '',
            keys:3
        },
        {
            id:2,
            header:'Patron',
            name: 'person1',
            position:'chief patron',
            contact : 9876543210,
            keys:4
        }, 
        
    ]
    return (
        <>
        <div className='section Accordian' id='team'>
            <h2 className='section__title'>ConferenceTeam</h2>
        </div>
        <Accordion defaultActiveKey={['0']} alwaysOpen className='accordion'>
            <Accordion.Item eventKey="0" >
                <Accordion.Header className='header'>Chief Patron</Accordion.Header>
                <Accordion.Body className='person-details'>
                    <img src={image} alt='demoimage' className='demoimage'/>
                    <div className='details'>
                        <p className='detail'>Name :Chief Patron</p>
                        <p className='detail'>Position :Patron</p>
                        <p className='detail'>Contact :1125566997</p>
                    </div>
                </Accordion.Body>
            </Accordion.Item>
            {
                details.map(({id,header,name,position,contact,keys})=>{
                    return(
                        <Accordion.Item key={id} eventKey={keys}>
                            <Accordion.Header className='header'>{header}</Accordion.Header>
                            <Accordion.Body className='person-details'>
                                <img src={image} alt='demoimage' className='demoimage'/>
                                 <div className='details'>
                                    <p className='detail'>Name :{name}</p>
                                    <p className='detail'>Position :{position}</p>
                                    <p className='detail'>Contact :{contact}</p>
                                </div>
                            </Accordion.Body>
                        </Accordion.Item>
                    )
                })
            }

             {
                details2.map(({id,header,name,position,contact,keys})=>{
                    return(
                        <Accordion.Item key={id} eventKey={keys}>
                            <Accordion.Header className='header'>{header}</Accordion.Header>
                            <Accordion.Body className='person-details'>
                                <img src={image} alt='demoimage' className='demoimage'/>
                                 <div className='details'>
                                    <p className='detail'>Name :{name}</p>
                                    <p className='detail'>Position :{position}</p>
                                    <p className='detail'>Contact :{contact}</p>
                                </div>
                            </Accordion.Body>
                        </Accordion.Item>
                    )
                })
            }
        </Accordion>
        </>
    )
}

    

export default ConferenceTeam;
